package main

func Exchange(lst1, lst2 []int) string {
	// Count even numbers in lst1
	evenCount := 0
	for _, num := range lst1 {
		if num%2 == 0 {
			evenCount++
		}
	}

	// Count even numbers in lst2
	for _, num := range lst2 {
		if num%2 == 0 {
			evenCount++
		}
	}

	// Check if we have enough even numbers to fill lst1
	if evenCount >= len(lst1) {
		return "YES"
	}
	return "NO"
}
